import React from 'react';
import './App.css';
import Footer from './Footer'
import Joke from './Joke';
import Header from './Header';
import logo from './logo.svg';

function App() {
  return (
    <div>     
      <Header />
      <Joke 
        question="How can you drop a raw egg onto a concrete floor without cracking it?" 
        answer=""
      />

      <Footer />
    </div> 
  );
}

export default App;
